import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { getArticles } from "../redux/actions/articles";
import ArticaleCard from "./ArticleCard";
import { Navbar } from "./Navbar";

const Articaleslist = () => {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getArticles());
    /* eslint-disable-next-line */
  }, []);
  const articles = useSelector((state) => state.articles.articales);

  return (
    <div>
      {/* {articles && articles.map((el) => <ArticaleCard el={el} />)} */}
      {articles &&
        articles.map((el) => (
          <div key={el.id}>
            <Navbar />
            <div>
              {console.log("test")}
              <div>{el.title}</div>
              <div>{el.description}</div>
              <div>{el.published}</div>
            </div>
          </div>
        ))}
      <div>{console.log("test1")}</div>
    </div>
  );
};

export default Articaleslist;
